import React from 'react';
import Post from '../Components/Post'

const Feed = props => {

    const feed = props.data.map(post => 
        <Post data={post}/>
    )

    return (
        <div style={styles.feedStyle}>
            {feed}
        </div>
    );
}

const styles = {
    feedStyle: {
        display: 'grid',
        gridTemplateColumns: 'repeat(6)',
        gridAutoRows: 'mixmax(150px, auto)',
        gridGap: '10px',
        maxWidth: '960px',
        margin: '0 auto'
    }
}

export default Feed;
